import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Home from './pages/Home';
import Footer from "./components/Footer"
import 'bootstrap/dist/css/bootstrap.css';

ReactDOM.render(
  <React.StrictMode>
    <Home />
         <Footer/>
  </React.StrictMode>,
  document.getElementById('root')
);

